import React from "react";
import { Link } from "react-router-dom";

const LeftRoom = () => {
  return (
    <div>
      <h1>Left room</h1>
      <ul>
        {" "}
        <li>
          <h2>Basement</h2>
          <Link to="/basement">Basement</Link>
        </li>
        <li>
          {/* <h2>Return</h2> */}
          <Link to="/house">Return</Link>
        </li>
      </ul>
    </div>
  );
};

export default LeftRoom;
